import React from 'react';
import { Launch } from '../Launch';
import Axios from 'axios';
import "./styles.scss";

export class Launches extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            launches: [],
            callBack: props.callBack
        }
    }
    componentDidMount = () => {
        console.log("mounted");
        console.log(this.props);
        const queryString = ("start=" + this.props.start + "&end=" + this.props.end);
        console.log('https://api.spacexdata.com/v3/launches/past?' + queryString);
        Axios.get('https://api.spacexdata.com/v3/launches/past?' + queryString)
            .then((response) => {
                this.setState({
                    launches: response.data.map((launch, index) => {
                        if (launch.rocket.second_stage.payloads) {
                            console.log("payloadful");
                            //console.log(launch.rocket.second_stage.payloads);
                            return <Launch
                                key={"Launch" + index}
                                links={launch.links}
                                img={launch.links.mission_patch}//to be removed
                                title={launch.mission_name}
                                date={launch.launch_date_utc}
                                desc={launch.details}
                                payloads={launch.rocket.second_stage.payloads}
                            />;
                        }
                        else {
                            console.log("payloadless");
                            return <Launch
                                key={"Launch" + index}
                                img={launch.links.mission_patch}
                                title={launch.mission_name}
                                date={launch.launch_date_utc}
                                desc={launch.details}
                            />;
                        }
                    })
                });
                console.log(this.state.launches);
            });
    }


    componentWillUnmount = () => {
        console.log("unmounted");
    }
    render = () => {
        return (
            <div className="launches">
                {this.state.launches}
            </div>
        );
    }
}
